import React from 'react';
import './styles.css';
import IFood from '../../assets/IFoodLogo.svg';
const Login: React.FC = () => {
    return(
        <>
                <ul className="menu">
                    <li className="options-menu">Pagina Inicial</li>
                    <li className="options-menu">Cadastre-se</li>
                    <li className="options-menu">Fazer Login</li>
                    <li className="options-menu">Sobre o sistema</li>
                </ul>


            <div className="image">
                <img src={IFood} alt="Logo IFood"/>
            </div>

            <form>
                <input type="text" placeholder="CPF"/>
                <input type="password" placeholder="Senha"/>
                <button>Login</button>
                <div className="links">
                    <a href="#">Sou um funcionário</a>
                    <a href="#">Não possuo LoginS</a>
                </div>
            </form>

        </>
    );
}

export default Login;
